def getcit(rez):
   citation_keys = ["creator", "title", "edition", "publisher", "publicationPlace", "publicationDate","physicalDescription", "isbns", "isbn13"]
   result = []
   for value in rez:
      value = value["metadata"]
      if "record" in value:
         record = value["record"]
         result.append( {key: record.get(key) for key in citation_keys})
   return result

